import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

import pageConfig from '../../utils/pageConfig';
import PageHeader from '../../components/PageHeader/PageHeader';
import { getActionsFormate } from '../../utils/common';
import listReducerStore from './ListPage.reducer';
import DataCards from '../../components/DataCards/DataCards';

class ListPage extends React.Component {
  constructor(props){
    super(props);

  }

  componentDidMount(){
    const {makeCall, actionType, page} = this.props;
    makeCall(actionType, '');
  }

  render(){
    const { pageTitle, actions, cardData } = pageConfig[this.props.page];

    return (
      <div className="list-page">
        <PageHeader title={pageTitle} actions={actions} />
        <DataCards data={cardData} />
        <div>Hello world</div>
      </div>
    );
  }

};

ListPage.propTypes = {
  page: PropTypes.string.isRequired,
  actionType: PropTypes.string.isRequired,
};

ListPage.defaultProps = {};

const mapStateToProps = state => ({
  cardData: listReducerStore.data
});
const mapDispatchToProps = dispatch =>{
  return {
    makeCall : (actionType, data)=>{
      dispatch(getActionsFormate(actionType,data))
    }
  };
}

export default withRouter(connect(mapStateToProps, mapDispatchToProps)(ListPage));
